import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row } from 'react-bootstrap';
import ActionsTracker from './ActionTracker';
import './ActionsTracker.css'

const App = () => {
  return (
    <Container>
      <h1>SHMCAP Action Tracker</h1>
      <Row>
        <ActionsTracker />
      </Row>
    </Container>
  );
}

export default App;
